import UIKit

struct Offering {
    
    enum Category {
        case food // 飲食・フード
        case service // 接客・サービス
        case sales // 販売
        case office // オフィスワーク
        case shipping // 軽作業・配送
        case event // イベント・キャンペーン
        case unknown
        
        init(raw: Int?) {
            guard let _raw = raw else {
                self = .unknown
                return
            }
            switch _raw {
            case 0: self = .food
            case 1: self = .service
            case 2: self = .sales
            case 3: self = .office
            case 4: self = .shipping
            case 5: self = .event
            default: self = .unknown
            }
        }
        
        var name: String {
            switch self {
            case .food: return "酒屋"
            case .event: return "イベ"
            case .office: return "PC"
            case .sales: return "販売"
            case .service: return "電話"
            case .shipping: return "運送"
            default: return "不明"
            }
        }
        
        var color: UIColor {
            switch self {
            case .food: return .brown
            case .event: return .purple
            case .office: return .orange
            case .sales: return .red
            case .service: return .blue
            case .shipping: return .magenta
            default: return .gray
            }
        }
    }
    
    let id: Int
    let location: (latitude: Double, longitude: Double)
    let workHour: String
    let salary: String
    let category: Category
    
    init(id: Int, location: (latitude: Double, longitude: Double), workHour: String, salary: String, category: Category) {
        self.id = id
        self.location = location
        self.workHour = workHour
        self.salary = salary
        self.category = category
    }
}

